import React from 'react';
import './App.css';
import Masthead from '../MastHead/MastHead.js'
import '@patternfly/react-core/dist/styles/base.css';
import {
  Text
} from '@patternfly/react-core';


function App() {
  return (
    <div>
      <Masthead></Masthead>
      <Text style= {{height:60}}>
      Events of the Week
       </Text>
    </div>
  );
}

export default App;

